using System.Text;

namespace HashedDirectoryStructure;

internal class Program
{
    static void Main(string[] args)
    {
        // Set parameters for the test
        int iterations = 65_536_000; // 65.536 million iterations
        int minCount = 800;
        int maxCount = 1200;
        string[] fileNames;

        // ---------------------------------------------------------
        // I. Generate an array of file name strings (from GUIDs)
        fileNames = GenerateFileNames(iterations);

        // Run the distribution test with the generated file names
        TestGuidDistribution(fileNames, minCount, maxCount);

        Console.ReadKey();
        Console.WriteLine();

        // ---------------------------------------------------------
        // II. Get CoverImageIds.
        // Set new parameters for the test
        fileNames = GetCoverImageIds();
        minCount = 0;
        maxCount = 2;

        // Run the distribution test with CoverImageIds
        TestGuidDistribution(fileNames, minCount, maxCount);

        Console.ReadKey();
        Console.WriteLine();

        // ---------------------------------------------------------
        // III. Get WorkshopIds.
        // Set new parameters for the test
        fileNames = GetWorkshopIds();
        minCount = 0;
        maxCount = 2;

        // Run the distribution test with GetWorkshopIds
        TestGuidDistribution(fileNames, minCount, maxCount);

        Console.ReadKey();
    }

    // Processes the array of file names and outputs a count for each derived path.
    private static void TestGuidDistribution(string[] fileNames, int minCount, int maxCount)
    {
        // Dictionary to count occurrences of each path
        Dictionary<string, int> counter = new Dictionary<string, int>();

        foreach (string fileName in fileNames)
        {
            string path = CreatePathFromFileName(fileName);
            if (counter.ContainsKey(path))
            {
                counter[path]++;
            }
            else
            {
                counter[path] = 1;
            }
        }

        int count = 0;
        foreach (var key in counter.Keys)
        {
            Console.WriteLine($"{++count}. {key}: {counter[key]}");

            if (counter[key] < minCount || counter[key] >= maxCount)
            {
                Console.WriteLine("Press any key to continue...");
                Console.ReadKey();
            }
        }

        Console.WriteLine("Test complete.");
    }

    private static int GetHashCodeString(string s)
    {
        int h = 0;
        if (!string.IsNullOrEmpty(s))
        {
            for (int i = 0; i < s.Length; i++)
            {
                h = (h << 5) - h + s[i];
            }
        }
        return h;
    }

    private static string CreatePathFromFileName(string fileName)
    {
        int hash = GetHashCodeString(fileName);
        int mask = 255;
        int firstDir = hash & mask;
        int secondDir = (hash >> 8) & mask;

        // Build the path using the directory separator and formatting each byte as two-digit hexadecimal.
        return new StringBuilder()
            .Append(Path.DirectorySeparatorChar)
            .Append(firstDir.ToString("x2"))
            .Append(Path.DirectorySeparatorChar)
            .Append(secondDir.ToString("x2"))
            .ToString();
    }

    // Generates an array of random file name strings based on GUIDs.
    private static string[] GenerateFileNames(int count)
    {
        string[] fileNames = new string[count];
        for (int i = 0; i < count; i++)
        {
            fileNames[i] = Guid.NewGuid().ToString();
        }
        return fileNames;
    }

